import ResponsiveDrawer from "../Components/Sidebar";
import Header from "../Components/Header";
import { Route, Routes } from "react-router-dom";

const PaymentPage = () => {
  const getRoutes = () => {
    Routes.map((route) => {
      return (
        <Routes>
          <Route exact path={route.path} element={route.element} />
        </Routes>
      );
    });
  };

  return (
    <div>
      <div>
        <Header />
      </div>
      <div>
        <ResponsiveDrawer />
      </div>
      <div></div>
    </div>
  );
};

export default PaymentPage;
